import React from 'react'
import {Layout, Menu} from "antd";
import {NavBarNotLogged} from "../components/NavBar/NavBarNotLogged";

const {Header, Content, Footer} = Layout

export const NotLogged = ({children}) => {
    return (
        <Layout style={{ minHeight:"100vh" }}>
            <Header className={"header"}>
                <Menu
                    className="menu"
                    theme="dark"
                    mode="horizontal"
                    style={{ backgroundColor: '#343a40' }}
                >
                    <Menu.Item className={"home-page"}>Home Page</Menu.Item>
                    <Menu.Item className={"sign-up"}>Sign-Up</Menu.Item>
                    <Menu.Item className={"login"}>Login</Menu.Item>
                </Menu>
            </Header>
            <Layout>
                <Content style={{ padding: '0 50px' }}> {children} </Content>
            </Layout>
            <Footer className={"footer"}>
                Blog Service @2021 - 2022 Created By Marcin Jurczyk
            </Footer>
        </Layout>

    );
};
